import 'poi/poi.dart';import 'profile.dart';import 'ticket.dart';class Meet {  Meet({    required this.id,    required this.title,    required this.description,    required this.size,    required this.date,    required this.price,    required this.createdAt,    required this.poi,    required this.createdBy,    required this.ticket,    this.canJoin,    required this.usersCount,    required this.isLocked,  });  factory Meet.fromJson(Map<String, dynamic> json) {    return Meet(      id: json['id'],      title: json['title'],      description: json['description'],      size: json['size'],      date: DateTime.parse(json['date']),      price: double.parse(json['price']),      createdAt: DateTime.parse(json['createdAt']),      poi: Poi.fromJson(json['poi']),      createdBy: Profile.fromJson(json['createdBy']),      ticket: Ticket.fromJson(json['ticket']),      canJoin: json['canJoin'],      usersCount: json['usersCount'],      isLocked: json['isLocked'],    );  }  int id;  String title;  String description;  int size;  DateTime date;  double price;  DateTime createdAt;  Poi poi;  Profile createdBy;  Ticket ticket;  bool? canJoin;  int usersCount;  bool isLocked;  Meet copyWith({    int? id,    String? title,    String? description,    int? size,    DateTime? date,    double? price,    DateTime? createdAt,    Poi? poi,    Profile? createdBy,    Ticket? ticket,    bool? canJoin,    int? usersCount,    bool? isLocked,  }) {    return Meet(      id: id ?? this.id,      title: title ?? this.title,      description: description ?? this.description,      size: size ?? this.size,      date: date ?? this.date,      price: price ?? this.price,      createdAt: createdAt ?? this.createdAt,      poi: poi ?? this.poi,      createdBy: createdBy ?? this.createdBy,      ticket: ticket ?? this.ticket,      canJoin: canJoin ?? this.canJoin,      usersCount: usersCount ?? this.usersCount,      isLocked: isLocked ?? this.isLocked,    );  }}